import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/process">
      <a style={linkStyle}>Processor</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/login">
      <a style={linkStyle}>Logout</a>
    </Link>
  </div>
);

export default Header;
